import React from 'react';
import { Link } from 'react-router-dom';

const Register = () => (
  <div className="container mt-5 text-center">
    <h2>Register</h2>
    <div className="mt-4">
      <Link to="/register/customer" className="btn btn-primary me-3">Customer</Link>
      <Link to="/register/owner" className="btn btn-secondary">Owner</Link>
    </div>
  </div>
);

export default Register;
